import React from "react";

//import reactstrap
import {
  Card,
  CardBody,
  FormGroup,
  Input,
  Container,
  Row,
  Col,
  Button,
  Form,
  CardFooter,
} from "reactstrap";

// core components
import SimpleHeader from "components/Headers/SimpleHeader.js";

import { ToastContainer, toast } from "react-toastify";

function FAQ() {
  return (
    <>
      <SimpleHeader name="FAQ" />
      <ToastContainer
        position="bottom-right"
        autoClose={5000}
        hideProgressBar={false}
        newestOnTop={false}
        closeOnClick
        rtl={false}
        pauseOnFocusLoss
        draggable
        pauseOnHover
        theme="colored"
      />
      <Container className="mt--6">
        <Card>
          <Form>
            <CardBody>
              <Row>
                <Col></Col>
              </Row>
            </CardBody>
          </Form>
        </Card>
      </Container>
    </>
  );
}

export default FAQ;
